Three ms. ownership inscriptions:
&quot;Johannes Casparus Henrius&quot;
&quot;Joannes Petrus Büöller&quot;
&quot;Carolus Büöller&quot;

&quot;DD Jo. Caluino I C Heydelbergensi Auctor dd.&quot;

Probably the inscription of Johannes Calvinus (also Johann Kahl), 1550-1614, Professor of Law at Heidelberg and author of several books on politics, Roman Law, Jewish Law and the judicial process.
DNB heading: <a href="http://viaf.org/viaf/52029866/#Kahl,_Johann,_1550-1614" rel="nofollow">Kahl, Johann, 1550-1614</a>

