BN heading: <a href="http://catalogue.bnf.fr/servlet/RechercheEquation;jsessionid=BC5817AC6B3B08B1FB373C83EEAA3E4F?TexteCollection=HGARSTUVWXYZ1DIECBMJNQLOKP&amp;TexteTypeDoc=DESNFPIBTMCJOV&amp;Equation=IDP=cb13513046p&amp;host=catalogue" rel="nofollow">Abbaye Notre-Dame-du-Val-des-Écoliers (Verbiesles, Haute-Marne)</a>

DNB heading: <a href="http://d-nb.info/gnd/4539665-6/about/html" rel="nofollow">Beata Maria Vallis Scholarium (Verbiesles)</a>

Ms. inscription ownership statement: &quot;Karl Hagenbach[?]. 

I am not certain which Karl Hagenbach this inscription belongs to.  This could be Karl Rudolph Hagenback, the Swiss theologian, historian, and doctor, established in VIAF as  <a href="http://viaf.org/viaf/45105468/#Hagenbach,_K._R._(Karl_Rudolf),_1801-1874" rel="nofollow">Hagenbach, K. R. (Karl Rudolf), 1801-1874.</a>  He was born and died in Basel, the place of imprint of the book this inscription appears in, where he taught at the university.  It could also belong to Karl Friedrich Hagenbach, established by DNB as <a href="http://viaf.org/viaf/40161248/#Hagenbach,_Karl_Friedrich_1771-1849" rel="nofollow"> Hagenbach, Karl Friedrich 1771-1849</a>.

Ms. bibliographic/authorship note: &quot;Carl Friederich Drollinger ist geboren 1688 zu Durlach. Gestorben 1742 als baden -- durlachischer Hosrath und archivarius.&quot;

Ms. inscription: &quot;J Johann Heinerich Papper Pepper [...] Grubben hagen 24: Nov, 1771 Grubben hagen.&quot;

This book also has a bookplate on front pastedown that reads &quot;University of Pennsylvania Presented in honor of Janet B. Pepper through the Alumni and Friends Book Fund 1978&quot;.

The inscription may be by Henry Pepper, originally Johan Heinrich Pfeffer, who was born in Strasbourg, Germany in 1738/39.  He moved to Pennsylvania and died in Philadelphia in 1808.  See <a href="http://familytreemaker.genealogy.com/users/p/e/p/George-W-Pepper/GENE1-0002.html" rel="nofollow">this genealogy.</a>  I haven't been able to find much about Janet B. Pepper, the donor of this book, yet or find their link....
